            case 9:
                return new QrCodeLoginException.SecretImport(FfiConverterString.INSTANCE.Read(stream));
            default:
                throw new InternalException(
                    String.Format("invalid error value '{0}' in FfiConverterTypeQRCodeLoginError.Read()", value)
                );
